import{o as e,c as r,a as t}from"./404.md.638dc6d3.js";const o='{"title":"Contributing to the Bedrock Wiki","description":"","frontmatter":{"hidden":true,"show_toc":false,"show_contributors":false,"title":"Contributing to the Bedrock Wiki"},"headers":[{"level":2,"title":"Bedrock OSS","slug":"bedrock-oss"},{"level":2,"title":"Contributing","slug":"contributing"}],"relativePath":"contribute.md","lastUpdated":1634303402178}',i={},n=t('<p>The Bedrock Wiki is fully open source. This means that is it maintained word-for-word by members of the community. If you&#39;ve spotted a typo, an unclear description, or a missing page, please consider helping us out by submitting changes!</p><h2 id="bedrock-oss"><a class="header-anchor" href="#bedrock-oss" aria-hidden="true">#</a> Bedrock OSS</h2><p>Bedrock OSS is a Github Organization that maintains many Bedrock resources, including the wiki! You can view our <a href="https://github.com/Bedrock-OSS" target="_blank" rel="noopener noreferrer">github organization here</a>, and our <a href="https://discord.gg/XjV87YN" target="_blank" rel="noopener noreferrer">Discord here</a>.</p><p>Getting in touch via <a href="https://discord.gg/XjV87YN" target="_blank" rel="noopener noreferrer">Discord</a> is the best way to discuss and learn about editing the wiki. We can offer support there in how to use github, how to make a pull request, and how to write valid markdown for the wiki.</p><h2 id="contributing"><a class="header-anchor" href="#contributing" aria-hidden="true">#</a> Contributing</h2><p>Instructions for editing the wiki can be found in the readme of our <a href="https://github.com/Bedrock-OSS/bedrock-wiki" target="_blank" rel="noopener noreferrer">github repository.</a>.</p>',6);i.render=function(t,o,i,a,s,d){return e(),r("div",null,[n])};export default i;export{o as __pageData};
